// Welcome.js

import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function Welcome() {
  const [name, setName] = useState("");
  const navigate = useNavigate();

  const enterGame = (e) => {
    e.preventDefault();
    if (name.trim() !== "") {
      // Redirect to another page with the submitted name
      navigate(`/welcome?name=${encodeURIComponent(name)}`);
    }
  };

  const instructionsPage = (e) => {
    navigate(`/instructions`);
  };

  return (
    <div>
      <br></br>
      <br></br>
      <br></br>
      <br></br>
      <br></br>
      <h1>Welcome to Our Mancala Game</h1>
      <br></br>
      <br></br>
      <br></br>
      <br></br>
      <div class="welcomebuttons">
        <form>
          <label htmlFor="name">Enter your name: </label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
          <button class="formButton" type="submit" onSubmit={enterGame}>
            Enter
          </button>
        </form>
        <button
          class="instructformButtonionsButton"
          type="submit"
          onSubmit={instructionsPage}
        >
          Instructions
        </button>
      </div>
    </div>
  );
}

export default Welcome;
